import React from 'react';
import {Link} from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';
const NavBar = () => (
    <React.Fragment>
        <nav>
            <ul>
                <li>
                    <Link to="/article-list">Articles</Link>
                </li>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/new-article">Make a Post</Link>
                </li>
            </ul>


        </nav>
    </React.Fragment>

);
export default NavBar;
